import React from 'react';
import './ImageLinkForm.css'

const ImageLinkForm = ({onInputChange,onSubmit}) => {
    return(    
    <div>
        <p className='f3 white'>
            {'This Magic Brain will detect faces.Please give it a try!'}
            <div className='center'>
                <div className=' form center pa4 br2 shadow-5'>
                <input className='f4 pa2 w-70 center' type='text' onChange={onInputChange}/>
                <button className='w-30 grow f4 link ph4 pr2 pv2 dib white bg-light-purple'onClick={onSubmit}>Detect</button>
                </div>
                
            </div>
        </p>
    </div>
    )
}

export default ImageLinkForm;
